export default {
    props:{
        list:{
            type:[Array,Object],
            default:function(){
                return [
                    {
                        icon:"home-o",
                        text:"栏目",
                        router:"/"
                    },
                    {
                        icon:"search",
                        text:"栏目",
                        router:"/about"
                    },
                    {
                        icon:"friends-o",
                        text:"栏目",
                        router:""
                    },
                    {
                        icon:"setting-o",
                        text:"栏目",
                        router:""
                    },
                ]
            }
        },
        active:Number
    },
    name:"tabBar",
    data(){
        return{
            activeNav:this.active
        }
    },
    methods:{
        clickItem(index,router){
            let that = this;
            router && (
                that.$router.push({
                    path:router
                })
            )
            this.activeNav = index;
            this.$emit('click',index)
        }
    }
}
